        <h3 class="subheading mb-5 h2" id="programmationWeb"></h3>
        <p class="lead mb-5">
        Le code est avant tout pour moi une passion.<br/>
        J'avais déjà fait 2- 3 projets web il y a 10 ans...<br/>
        J'ai profité du 1er confinement pour passer une formation à distance de développeur web avec à la clé un diplôme obtenu en Août 2020 !<br/>
        Je suis autodidacte à 100%, n' hésitez pas à prendre contact avec moi si vous avez un projet. 
        </p>
